INSERT INTO `license_purpose` VALUES (1,'COMM','Commercial','This category is for standard customer licenses for MSC products',0,1,NULL,'ep,ey,my,ml',0,1,'2015-12-14 18:15:57','0000-00-00 00:00:00'),(2,'COMMREHOST','Commercial - Rehost','This category is for existing commercial licenses that are being re-hosted on a new license server.',0,1,NULL,'ep,ey,my,ml',0,1,'2015-12-14 18:15:57','0000-00-00 00:00:00'),(3,'EMP','Employee ','This category is for licenses issued to active, full-time, regular MSC employees for use in their work.  Product Seat Licensing (PSL) is available for this category.',1,1,'ey,my',NULL,1,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(4,'NFR','Not For Resale','NFR licenses are for use by MSC\'s partners, for general demonstration and training purposes.  Product Seat Licensing (PSL) is available for this category.',0,1,'ey,my','ey,my,ml',1,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(5,'TRAINING','Training','This category is for licenses used in MSC-sponsored training sessions.  Product Seat Licensing (PSL) is available for this category.',1,1,'e7,m7','e21,e14,e7',1,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(6,'ER','Emergency','This category is for licenses generated for short-term use in urgent situations, such as when a travelling employee\'s computer fails and they need a license for a replacement system.',1,1,'e7,m7',NULL,0,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(7,'DEMO','Demonstration','This category is for licenses used for demonstrating MSC products  Product Seat Licensing (PSL) is available for this category.',1,1,'e7,m7','e21,e14,e7',1,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(8,'TEMP','Temporary','This category is for licenses issued for customers who have placed an order, but have not specified their final license server host, or when the intended license server is unavailable for a short time.',0,1,'e30,m30','e30,e60,e90,m30,m60,m90',0,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(9,'EVAL','Evaluation','This category is for short-duration licenses used by prospective customers in evaluating MSC products, Product Seat Licensing (PSL) is available for this category.',0,1,'e30,m30','e30,e60,e90,m30,m60,m90',1,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(10,'PARTNER','Technology Partners','This category is for licenses provided to MSC\'s partners, for their use in testing, evaluation, development, and demonstrations.',0,1,'ey,my','ey,my,ml',0,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(11,'TEST','Testing','This category is for licenses created for use by MSC employees for testing various MSC products and processes.',1,1,'ey,my',NULL,0,0,'2015-10-05 22:07:40','0000-00-00 00:00:00'),(13,'UPDATE','Update an existing license','Update an existing license by changing the customer information, hostid, expiration date, and/or maintenance date.',0,1,NULL,NULL,0,0,'2015-10-05 22:07:40','0000-00-00 00:00:00');
