INSERT INTO `lpfeats_delivery` VALUES (1,'bnc','NASTRAN','2011-11-12 04:47:24','/* Updated 2011-11-11  20:47:24 by bnc.  Contact license.support@mscsoftware.com for information. */\n\n#ifndef LPFEATS_H_INCLUDED\r\n#define LPFEATS_H_INCLUDED\r\n\r\n/* -----------------------------------------------------------------------------------------------------\r\n *\r\n * 31 Aug 2011  NJR  Update maint to 2011-0901, for 2011.2 Beta2 and use by SimX Aero, Adams ViewFlex\r\n * 15 Aug 2011  NJR  Add new structure for OEM Nastran; remove User_Modifiable (9043/1035, UMNA)\r\n * 29 Aug 2011  NJR  Add separate structure for EFEA coding (licfeatEFEA,  Adv Acoustics)\r\n * 21 Jul 2011  NJR  Update maint to 2011-0801, likely for 2011.2 Beta1\r\n *                   Remove RCPT, LAMR, CPBM; also clean out Topo.Opt. + NA/MDNL_* features (4101,4102)\r\n * 20 Jul 2011  NJR  Add NA_GPU (10509) w/o SE inclusion\r\n * 19 Apr 2011  NJR  Add MSC_UTIL_CRC; update maintenance to 2011-0501\r\n * 07 Apr 2011  NJR  Update maintenance to 2011-0415 for 2011.1 release\r\n * 14 Jan 2011  NJR  Add 3001 & 3002 (Thermal, Nonlinear, normally embedded)\r\n * 17 Dec 2010  NJR  Update SE maintenance to 2011-0201\r\n *\r\n * Ordered alphabetically by feature name, fields in each entry are:\r\n *       PID (product identifier)\r\n *       encryption\r\n *       version date\r\n *       feature name (will appear in the client\'s license file)\r\n *       product name (as it will be known in app displays or Price Book\r\n * -----------------------------------------------------------------------------------------------------\r\n */\r\n\r\n\r\n#define LIC_ID_NASTRAN                  3000\r\n#define LIC_ID_NA_ACMS                  3014\r\n#define LIC_ID_NA_ADAMS_Integration    10233\r\n#define LIC_ID_NA_Acoustics            10058\r\n#define LIC_ID_NA_Adv_Acoustics        10473\r\n#define LIC_ID_NA_Adv_Nonlinear        10363\r\n#define LIC_ID_NA_Adv_PFA              10442\r\n#define LIC_ID_NA_Adv_Thermal          10475\r\n#define LIC_ID_NA_Aero                  3007\r\n#define LIC_ID_NA_AeroLoads            10355\r\n#define LIC_ID_NA_Connectors           10002\r\n#define LIC_ID_NA_DDAM                 10209\r\n#define LIC_ID_NA_DMAP                  3005\r\n#define LIC_ID_NA_DMP                   1020\r\n#define LIC_ID_NA_Dynamics              3003\r\n#define LIC_ID_NA_Exterior_Acoustics   10360\r\n#define LIC_ID_NA_GPU                  10509\r\n#define LIC_ID_NA_Krylov_Solver        10234\r\n#define LIC_ID_NA_Linear_Contact       10464\r\n#define LIC_ID_NA_LSDYNA_Translator    10275\r\n#define LIC_ID_NA_MARC_Translator      10077\r\n#define LIC_ID_NA_MultiOpt             10488\r\n#define LIC_ID_NA_Nonlinear             3002\r\n#define LIC_ID_NA_Optimization          1031\r\n#define LIC_ID_NA_PAA                  10474\r\n#define LIC_ID_NA_Rotor_Dynamics       10232\r\n#define LIC_ID_NA_SMP                   1030\r\n#define LIC_ID_NA_Stochastic           10078\r\n#define LIC_ID_NA_Superelements         3006\r\n#define LIC_ID_NA_Thermal               3001\r\n#define LIC_ID_NA_Zona                  1034\r\n\r\n\r\n#define LIC_ID_OEM_NASTRAN            103000\r\n#define LIC_ID_OEM_ACMS               103014\r\n#define LIC_ID_OEM_ADAMS_Integration  110233\r\n#define LIC_ID_OEM_Acoustics          110058\r\n#define LIC_ID_OEM_Adv_Acoustics      110473\r\n#define LIC_ID_OEM_Adv_Nonlinear      110363\r\n#define LIC_ID_OEM_Adv_PFA            110442\r\n#define LIC_ID_OEM_Adv_Thermal        110475\r\n#define LIC_ID_OEM_Aero               103007\r\n#define LIC_ID_OEM_AeroLoads          110355\r\n#define LIC_ID_OEM_Connectors         110002\r\n#define LIC_ID_OEM_DDAM               110209\r\n#define LIC_ID_OEM_DMAP               103005\r\n#define LIC_ID_OEM_DMP                101020\r\n#define LIC_ID_OEM_Dynamics           103003\r\n#define LIC_ID_OEM_Exterior_Acoustics 110360\r\n#define LIC_ID_OEM_GPU                110509\r\n#define LIC_ID_OEM_Krylov_Solver      110234\r\n#define LIC_ID_OEM_Linear_Contact     110464\r\n#define LIC_ID_OEM_LSDYNA_Translator  110275\r\n#define LIC_ID_OEM_MARC_Translator    110077\r\n#define LIC_ID_OEM_MultiOpt           110488\r\n#define LIC_ID_OEM_Nonlinear          103002\r\n#define LIC_ID_OEM_Optimization       101031\r\n#define LIC_ID_OEM_PAA                110474\r\n#define LIC_ID_OEM_Rotor_Dynamics     110232\r\n#define LIC_ID_OEM_SMP                101030\r\n#define LIC_ID_OEM_Stochastic         110078\r\n#define LIC_ID_OEM_Superelements      103006\r\n#define LIC_ID_OEM_Thermal            103001\r\n#define LIC_ID_OEM_Zona               101034\r\n\r\n\r\n\r\nstatic struct tagLicFeat licfeatEFEA[] = {\r\n { 10473, 0xd8eb44, \"2011.1115\", \"NA_Adv_Acoustics\",                      \"MSC.Nastran Advanced Acoustics\"}, \r\n {     0, 0x000000, \"\", \"\", \"\"}\r\n} ;\r\n\r\n\r\n\r\n#ifdef _MSCUTIL\r\nstatic struct tagLicFeat licfeatUTIL[] = {\r\n { 10507, 0x8c3b2d, \"2011.1115\", \"MSC_UTIL_CRC\",                          \"Nastran Utility CRC Generator\"}, \r\n {     0, 0x000000, \"\", \"\", \"\"}\r\n} ;\r\n#endif  /* end structure definition Nastran Utilities */\r\n\r\n\r\n\r\n\r\n#ifdef _NASTRAN\r\n/* -----------------------------------------------------------------------------------------------------\r\n * Define structures which are used when product is some form of NASTRAN.\r\n * (MD Nastran&Toolkit, Nastran&Toolkit, FEA, CATIA, MD Desktop, Sim*).\r\n * The correct PID has been used in the tagLicFeat entries unless there are\r\n * dependencies (e.g., NA_Aero remains 3007 because Zona (1034) includes it,\r\n * and changing all client license files using actual PIDs wouldn\'t be worthwhile.\r\n * ----------------------------------------------------------------------------------------------------- */\r\n\r\n\r\n/* -----------------------------------------------------------------------------------------------------\r\n * These are the standard Nastran features and the corresponding toolkit entry.\r\n * ----------------------------------------------------------------------------------------------------- */\r\n#ifndef STD_NASTRAN_FEATURES\r\n#define STD_NASTRAN_FEATURES\\\r\n {  3000, 0x1e22ac, \"2011.1115\", \"NASTRAN\",                               \"MSC.Nastran\"}, \\\r\n {  3014, 0x16e822, \"2011.1115\", \"NA_ACMS\",                               \"MSC.Nastran ACMS\"}, \\\r\n { 10233, 0x6a2218, \"2011.1115\", \"NA_ADAMS_Integration\",                  \"MSC.Nastran ADAMS Integration\"}, \\\r\n { 10058, 0xc185a3, \"2011.1115\", \"NA_Acoustics\",                          \"MSC.Nastran Acoustics\"}, \\\r\n { 10473, 0xd8eb44, \"2011.1115\", \"NA_Adv_Acoustics\",                      \"MSC.Nastran Advanced Acoustics\"}, \\\r\n { 10363, 0x5fb447, \"2011.1115\", \"NA_Adv_Nonlinear\",                      \"MSC.Nastran Advanced Nonlinear\"}, \\\r\n { 10442, 0xf35759, \"2011.1115\", \"NA_Adv_PFA\",                            \"MSC.Nastran Advanced PFA\"}, \\\r\n { 10475, 0x912910, \"2011.1115\", \"NA_Adv_Thermal\",                        \"MSC.Nastran Advanced Thermal\"}, \\\r\n {  3007, 0xe47b0e, \"2011.1115\", \"NA_Aero\",                               \"MSC.Nastran Aero - Basic\"}, \\\r\n { 10355, 0xccd633, \"2011.1115\", \"NA_AeroLoads\",                          \"MSC.Nastran Aero Loads\"}, \\\r\n { 10002, 0xb151ed, \"2011.1115\", \"NA_Connectors\",                         \"MSC.Nastran Connectors\"}, \\\r\n { 10209, 0xab1c70, \"2011.1115\", \"NA_DDAM\",                               \"MSC.Nastran DDAM\"}, \\\r\n {  3005, 0x3b590e, \"2011.1115\", \"NA_DMAP\",                               \"MSC.Nastran DMAP Compile\"}, \\\r\n {  1020, 0x2a5f8c, \"2011.1115\", \"NA_DMP\",                                \"MSC.Nastran DMP\"}, \\\r\n {  3003, 0xdf1109, \"2011.1115\", \"NA_Dynamics\",                           \"MSC.Nastran Dynamics\"}, \\\r\n { 10360, 0x4b39a4, \"2011.1115\", \"NA_Exterior_Acoustics\",                 \"MSC.Nastran Exterior Acoustics\"}, \\\r\n { 10509, 0x2d746f, \